import { React, useState } from "react";
import TextField from 'react'
//import List from "./Components/List"
import './SearchBarElements.css';
const SearchBar = () => {
  return (
    //<div>SearchBar</div>
    <div className="main">
      <h1>React Search</h1>
      <div className="search">
        <TextField
          id="outlined-basic"
          variant="outlined"
          fullWidth
          label="Search"
        />
      </div>
      {/* <List /> */}
    </div>
  )
}

export default SearchBar
